INSERT INTO `comportamiento` (`id`, `tipo`, `descripcion`) VALUES
(1, 'DS', 'La forma en que manejas las relaciones convivenciales con cada uno de los miembros de la comunidad educativa al igual que tu excelente presentación personal te hacen merecedor (a) de una felicitación especial.  Al poner en práctica los valores adquiridos en el colegio y el hogar aseguras la formación de una sólida personalidad que te llevará a triunfar en todos los aspectos de tu vida.'),
(2, 'DA', 'Felicitaciones, tienes muchas capacidades para relacionarte con todos los miembros de tu comunidad educativa, de manera respetuosa y cordial, además con facilidad entablas relaciones de amistad con tus compañeros. Continúa ejercitándote en valores como la puntualidad, la buena presentación personal y la lectura de libros edificantes para la construcción de una sana personalidad.'),
(3, 'DB', 'En ocasiones cultivas buenas relaciones con los demás, pero te falta la constancia y el buen tacto para hacerlo con todos y en la mayoría de las circunstancias que te presenta el entorno escolar, realiza un esfuerzo para ejercitarte en el uso de la comunicación asertiva, al igual que en la puntualidad, eso te asegurara mejores resultados en el aspecto académico y convivencial. Comienza ahora. Tú puedes.'),
(4, 'D-', 'Cultiva actitudes positivas que te permitan mejorar las relaciones de convivencia con tus compañeros; La puntualidad es esencial en el proceso de formación porque nos hace personas constantes y disciplinadas, esmérate por conseguirla; Tienes cualidades que puedes aprovechar para alcanzar el máximo de tus potencialidades, empieza a descubrirlas y a dar lo mejor de ti. Animo.');
